<template>
  <view class="page-login">
    <view
      v-if="canIUse || canIGetUserProfile"
      class="uni-padding-wrap uni-common-mt loginBox"
    >
      <view class="demo">
        <view class="logoImage">
          <image
            style="height: 300rpx"
            mode="aspectFit"
            src="../../static/logo.png"
          ></image>
        </view>
        <view class="logoText">
          <!-- <view>这里是一句logo多打一点字看看能不能居中</view>
                    <view>This is a logo</view> -->
        </view>
        <view class="login-box">
          <!--新版登录方式-->
          <button
            v-if="canIGetUserProfile"
            class="login-btn"
            @click="bindGetUserInfo"
          >
            授权登录
          </button>
          <!--旧版登录方式-->
          <button
            v-else
            class="login-btn"
            open-type="getUserInfo"
            withCredentials="true"
            lang="zh_CN"
            @getuserinfo="bindGetUserInfo"
          >
            授权登录
          </button>
        </view>
      </view>
    </view>

    <view v-else class="text-center"> 请升级微信版本 </view>
  </view>
</template>
<script>
import { mapMutations } from 'vuex'
export default {
  data() {
    return {
      sessionKey: "",
      openId: "",
      nickName: null,
      avatarUrl: null,
      userInfo: {},
      canIUse: uni.canIUse("button.open-type.getUserInfo"),
      canIGetUserProfile: false,
      code: "",
      isLogin: false,
    };
  },
  created() {
    if (this.$store.state.hasLogin) {
      this.go();
    }
    var _this = this;
    // console.log(uni.getUserProfile);
    if (uni.getUserProfile) {
      this.canIGetUserProfile = true;
    }
    //判断若是版本不支持新版则采用旧版登录方式
    //查看是否授权
    if (!this.canIGetUserProfile) {
      uni.getSetting({
        success: function (res) {
          if (res.authSetting["scope.userInfo"]) {
            uni.getUserInfo({
              provider: "weixin",
              success: function (res) {
                //console.log(res);
                _this.userInfo = res.userInfo;
                try {
                  _this.login();
                } catch (e) {}
              },
              fail(res) {},
            });
          } else {
            // 用户没有授权
            console.log("用户还没有授权");
          }
        },
      });
    }
  },
  mounted() {},
  methods: {
    ...mapMutations('user',[
      'setUserInfo',
    ]),
    //登录授权
    bindGetUserInfo(e) {
      var _this = this;
      if (this.canIGetUserProfile) {
        //新版登录方式
        uni.getUserProfile({
          desc: "登录",
          success: (res) => {
            _this.userInfo = res.userInfo;
            _this.nickName = res.userInfo.nikeName;
            _this.avatarUrl = res.userInfo.avatarUrl;
            try {
              _this.login();
            } catch (e) {}
          },
          fail: (res) => {
            console.log(res);
          },
        });
      } else {
        //旧版登录方式
        if (e.detail.userInfo) {
          //用户按了允许授权按钮
          //console.log('手动');
          //console.log(e.detail.userInfo);
          _this.userInfo = e.detail.userInfo;
          try {
            _this.login();
          } catch (e) {}
        } else {
          console.log("用户拒绝了授权");
          //用户按了拒绝按钮
        }
      }
    },
    //登录
    login() {
      let _this = this;
      // 获取登录用户code
      uni.login({
        provider: "weixin",
        success: function (res) {
          if (res.code) {
            _this.code = res.code;
            //将用户登录code传递到后台置换用户SessionKey、OpenId等信息
            //...写用code置换SessionKey、OpenId的接口
            //置换成功调用登录方法_this.updateUserInfo();
            _this.updateUserInfo();
          } else {
            uni.showToast({ title: "登录失败！", duration: 2000 });
            console.log("登录失败！" + res.errMsg);
          }
        },
      });
    },
    //向后台更新信息
    updateUserInfo() {
      uni.showLoading({
        title: "登录中...",
      });
      let _this = this;
      let params = {
        userName: _this.userInfo.nickName,
        code: _this.code,
      };
      this.$request({
        url: "/user/userBind",
        method: "POST",
        data: params,
      }).then((res) => {
        uni.setStorage({
          key: "user",
          data: res.data,
          success: function () {
            console.log("success");
          },
        });
        this.setUserInfo(res.data);

        this.$store.state.hasLogin = true;
        this.go();
      });
    },
    go() {
      uni.switchTab({
        url: "../index/index",
      });
    },
  },
};
</script>
